    render(){
        return(
            <div style={{ display: 'flex', alignItems: 'flex-start' }}>
                <head>
  <link
    href="https://fonts.googleapis.com/css?family=Yesava+One&display=swap"
    rel="stylesheet"
  />
</head>
        <img
          src="/leave.png"
          alt="leaving"
          style={{ float: 'right', width: '70%', height: 'auto' }}
